import styled from 'styled-components';

const Layout = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
`;

const Footer = () => {
  return (
    <Layout>
      <h1>Footer</h1>
    </Layout>
  );
};

export default Footer;
